import doubleRoom from '../images/doubleRoom1.jpg'

const rooms = [
    {
        imgLink: singleRoom,
        roomType: "Single",
        rate: "$150",
        id: uuidv4()
    },
    {
        imgLink: doubleRoom,
        roomType: "Double",
        rate: "$220",
