    {
        imgLink: doubleRoom,
        roomType: "Double",
        rate: "$200",
        id: uuidv4()
    },
    {
        imgLink: doubleRoom,
        roomType: "Double",
        rate: "$300",
        id: uuidv4()
    },
    {
        imgLink: doubleRoom,
        roomType: "Double",
        rate: "$280",
        id: uuidv4()
    },
]


function ClerkRoomDisplay() {
    return (
        <div className="display">
            {rooms.map((room) =>(
                <RoomModifyAndStatus className="room-display" key={room.id} imgLink={room.imgLink} title={room.roomType} cost={room.rate}/>
            ))}
        </div>
    );
}

export default ClerkRoomDisplay;
